  input: TEXT,SB29,SB29.5102,"Our Committee primarily does state political work. Our
    allocation for federal is 14.29%. Our Coimmittee maintains an office. In August,
    2001 I was told that Frank P. Barbaro was, individually, going to pay directly
    to an existing worker at our office approximately $1,000 per month as a donation.  I
    called FEC and was told to simply log it as an in-kind contribution. In preparing
    the year-end FEC report I got a listing of the payments made to the worker by
    Mr. Barbaro. Then, on March 5, 2002, I was shocked to learn, for the first time,
    that Mr. Barbaro had made the payments to the office worker on his corporate account
    'Frank P. Barbaro, Inc.', his one-man, professional corporation. On March 15,
    2002, I called the FEC and spoke with 'Julie' about the situation and how best
    to report and deal with the discovery. She recommended reporting the contributions
    as I had believed them to be, from an individual, until I learned of the problem
    in March, 2002, and then transfer the federal proportion to our Committee's state
    account, and submit this memo with the April 15, 2002 report. That is what I have
    done. The fed share (14.29%) of each of the 14 payments of $600 from Mr. Barbaro's
    corporation received until discovery is the amount of this transfer from the fed
    to our state account, made the day I spoke to Julie. I am assured no further payments
    will be made by Mr. Barbaro's corporation."
